import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './pages/home';
// import NavBar from './components/navbar';
import './App.css';

function App() {
  return(
  <BrowserRouter>
    <Switch>
      <Route exact path="/" component ={Home} />

    </Switch>

  </BrowserRouter>
  );
}


export default App;
